import React from "react";

function skills() {
  return (
    <div className="skills">
      <ul id="skillsMenu">
        <li className="skillsList">1</li>
        <li className="skillsList">2</li>
        <li className="skillsList">3</li>
        <li className="skillsList">4</li>
        <li className="skillsList">5</li>
        <li className="skillsList">6</li>
      </ul>
    </div>
  );
}

export default skills;
